from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    if not triples:
        return ""

    sentence = ""
    subject = triples[0].subject

    for i, triple in enumerate(triples):
        if i == 0:
            sentence += f"{subject} {triple.predicate} {triple.object}"
        else:
            predicate = triple.predicate
            object_val = triple.object
            if predicate == "league":
                sentence += f", playing in the {object_val}"
            elif predicate == "manager":
                sentence += f", managed by {object_val}"
            elif predicate == "birthDate":
                sentence += f", born on {object_val}"
            elif predicate == "birthPlace":
                sentence += f", originally from {object_val}"
            elif predicate == "currentclub":
                sentence += f", currently playing for {object_val}"
            else:
                sentence += f" and their {predicate} is {object_val}"

    return sentence + "."

